<p>自从使用github以来，一直都是在<a href="https://link.jianshu.com/?t=https://github.com/" target="_blank" rel="noopener noreferrer">github网站</a>在线上传文件到仓库中，但是有时因为网络或者电脑的原因上传失败。最重要的原因是我习惯本地编辑，完成以后再一起上传github。看过了几个教程，总结出最适合自己的比较简单的方法。</p>
